import '../styles/Product.scss'
import { IoCart } from 'react-icons'

const Product = ({product}) => {

  const CartBtn = () => (<button className="btn btn-sm btn-outline-primary">Add to cart <IoCart/> </button>)

  return (
    <div className="product col-2" key={product.id}>
      <img src={product.image} alt="product" className="produdct-image"  />
      <div className="product-title">{product.title}</div>
      <div className="product-price">{product.price}$ <CartBtn /> </div>
    </div>
  )
}

export default Product
